import React from 'react';
import './DeliveryOptions.css';

const DeliveryOptions = () => {
  return (
    <div>
      <h2>Способы доставки</h2>
      <p>Вы можете выбрать курьерскую доставку или самовывоз из магазина.</p>
    </div>
  );
};

export default DeliveryOptions;
